import Card from 'react-bootstrap/Card';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { useState } from 'react';

const Categories=()=> {
  const [student, setStudent] = useState([
    {
      name: 'Sandesh Lokhande',
      position: 'Head',
      email: 'sandeshlokhande1002@gmail.com',
      contact: '9423166073'
    },
    {
      name: 'Sanika Raut',
      position: 'Co-Head',
      email: 'sanikaraut23@gmail.com',
      contact: '9876543210'
    },
    {
      name: 'Sayali Pol',
      position: 'Publicity Head',
      email: 'sayalipol93@mail.com',
      contact: '7997668776'
    },
    {
      name: 'Amit Kumar',
      position: 'Content Head',
      email: 'ak6202753@mail.com',
      contact: '9985654355'
    },
    {
      name: 'Pratiksha Jadhav',
      position: 'Publicity Head',
      email: 'jpratiksha753@mail.com',
      contact: '9887675555'
    }
  ]);
  return (
    
    <div>
    <h2 className='text-center m-5'>Student</h2>
     <Row xs={1} md={3} className="g-4">
     {student.map((student, idx) => (
       <Col key={idx}>
         <div className='my-4'>
           <Card>
             <img
               src="https://cdn.pixabay.com/photo/2020/07/01/12/58/icon-5359553_1280.png"
               roundedCircle
               width="100"
               height="100"
               className="rounded-circle shadow-1-strong center"
               style={{ margin: "auto" }}
             />
             <Card.Body style={{ marginLeft: '2vw' , fontFamily:'emoji'}}>
               <Card.Title>Name: {student.name}</Card.Title>
               <Card.Text>
                 <h5>Position: {student.position}</h5>
                 <h5>Email: {student.email}</h5>
                 <h5>Contact: {student.contact}</h5>
               </Card.Text>
             </Card.Body>
           </Card>
         </div>
       </Col>
     ))}
   </Row>
   </div>
  );
}

export default Categories;
